import React,{useState} from 'react';
import './header.css';
import logo from './assets/logo.png';
import Drawer from './drawer';


function Header() {
    const [isDrawerOpen, setDrawerOpen] = useState(false);

    const toggleDrawer = () => {
        setDrawerOpen(!isDrawerOpen);
    };
    return (
        <header className="header">
            <div className="logo">
                <img src={logo} alt="Logo" />
            </div>
            <nav className="nav">
                <a href="#home" onClick={(e) => { e.preventDefault(); toggleDrawer(); }}>Who are we</a>
                <a href="#about">Why Choose Us</a>
                <a href="#services">What Do We Do</a>
                <a href="#pricing">Contact Us</a>
            </nav>
            <Drawer isOpen={isDrawerOpen} onClose={toggleDrawer}>
                <h2>Who are we</h2>
                <p>We are a company that specializes in providing top-notch services to our clients...</p>
            </Drawer>
        </header>
    );
}

export default Header;
